  false,\n\t\"url\": null,\n\t\"notes\": \"This is an archive of data from moorings
  deployed in Bering Strait from summer 2009 to summer 2010. Mooring deployments were
  funded by the NOAA RUSALCA (Russian-US Long Term Census of the Arctic) program.nnFor
  2009 to 2010, a total of eight moorings were deployed. Sites A1, A2, and A3 were
  established in 1990. A2 and A3 have been occupied almost continuously (all years
  except 96-97) since then. A1 was occupied for a few years from 1990,(90-91, 92-94)
  and then again since 2004. Site A4 was established in 2001. Sites A1E and A1W were
  established in 2005, and also carry Russian instrumentation not included in this
  archive (although documented in the cruise reports and here). Sites A2W and A4W
  were established in 2007.nnFor an overview of previous and on-going Bering Strait
  mooring work, please see http://psc.apl.washington.edu/BeringStrait.html.nnMoorings
  carry a variety of instruments. Please see the cruise report for details.\",\n\t\"owner_org\":
